import React, { useState, useEffect } from 'react';

// URL
import { allAssistants } from '../../../settings';

// Styles
import { MyBody, MyButton, UserTable } from './UserEndPoint.styles';

const UserEndPoint = () => {
  const [users, setUsers] = useState([{}]);

  const fetchUsers = async (URL) => {
    const response = await fetch(URL, {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
      },
    });
    const myUsers = await response.json();

    setUsers(
      myUsers.map((user) => {
        return user;
      })
    );
  };
  useEffect(() => {
    fetchUsers('https://jsonplaceholder.typicode.com/users');
  }, []);

  return (
    <MyBody>
      <UserTable>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Website</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={+user.id}>
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.username}</td>
              <td>{user.email}</td>
              <td>{user.phone}</td>
              <td>{user.website}</td>
            </tr>
          ))}
        </tbody>
      </UserTable>
    </MyBody>
  );
};

export default UserEndPoint;
